import styles from './Projects.module.scss'

import Developments from 'components/Developments'
import Banner from 'components/Banner'

import posts from 'json/posts.json'
import image from 'assets/sammy-line.png'

//Illustration by <a href="https://icons8.com/illustrations/author/627444">Julia G</a> from <a href="https://icons8.com/illustrations">Ouch!</a>

export default function Projects() {
  return (
    <main>
      <Banner 
        title="Projects" 
        description="" 
        img={image} 
        alt="Illustration by Julia G" 
        link="https://icons8.com/illustrations/author/627444"
      /> 
      <ul className={styles.posts}>
        {posts.map((post) => {
          return (
            <li key={post.id}>
              <Developments key={post.id} post={post}/> 
            </li>                     
          )
        })}
      </ul>
    </main>
  )
}
